import React, { useState } from "react";
import "../css/App.css";
import FileDisplay from "./FileDisplay";
import Upload from "./Upload";
const App = () => {
  const [file, setFile] = useState();

  return (
    <div className="app">
      {file ? <FileDisplay file={file}/> : <Upload setFile={setFile} />}
    </div>
  );
};

export default App;
